1-й умный тональный крем с IQ-технологией идеально подстраивается под оттенок и текстуру кожи, обеспечивая безупречное слияние с ней.
* 100% естественный тон;
*лёгкая текстура без "эффекта маски";
* подходит для всех типов кожи.
#косметика#корректор#тональныйкрем#купитькрем

